  const { id }: any = useParams();
  const [postDetails, setPostDetails] = React.useState({});

  useEffect(() => {
    console.log("id", id);  
    var todos = Gun().get("todos");

    todos.get(id).on(function(data, key){
      setPostDetails({title: data.title});
      console.log("data", data.title, key);
    })
    // todos.map().on(function (todo, id) {
    // });
  }, []);

  return (
    <div>QuestionsPage:: {id}</div>
  )
}
